// src/components/ProductList.js
import React from 'react';
import Product from './Product';

function ProductList({ onAddToCart }) {
  const products = [
    { id: 1, name: 'Produkt 1', description: 'Beskrivning av produkt 1', price: 100, image: 'https://via.placeholder.com/150' },
    { id: 2, name: 'Produkt 2', description: 'Beskrivning av produkt 2', price: 200, image: 'https://via.placeholder.com/150' },
    { id: 3, name: 'Produkt 3', description: 'Beskrivning av produkt 3', price: 300, image: 'https://via.placeholder.com/150' },
    { id: 4, name: 'Produkt 4', description: 'Beskrivning av produkt 4', price: 400, image: 'https://via.placeholder.com/150' },
    { id: 5, name: 'Produkt 5', description: 'Beskrivning av produkt 5', price: 500, image: 'https://via.placeholder.com/150' },
    { id: 6, name: 'Produkt 6', description: 'Beskrivning av produkt 6', price: 600, image: 'https://via.placeholder.com/150' },
  ];

  return (
    <div className="row">
      {products.map(product => (
        <Product key={product.id} product={product} onAddToCart={onAddToCart} />
      ))}
    </div>
  );
}

export default ProductList;
